import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
class About extends Component {
    render() {
        return (
            <MDBContainer>
                <MDBRow>
                    <MDBCol xl="6" lg="6">.col-lg-6</MDBCol>
                    <MDBCol xl="6" lg="6">.col-lg-6</MDBCol>
                </MDBRow>

            </MDBContainer>
        );
    }
}

export default About;
